var game;
var gameLoaded = false;
var createOnLoaded = false;
var bool = 0
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        this.bg = this.add.image(0, 0, 'bg').setOrigin(0, 0)
        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);
        // this.input.setDefaultCursor('url(' + assets.pencil_1 + '), pointer');



        this.farmer_pic = this.add.image(120, 100 + 60, 'farmer_picbg')
        this.farmer_pic.scaleX = 0.8
        this.farmer_pic.scaleY = 0.8
        this.police_pic = this.add.image(120, 280 + 60, 'police_picbg')
        this.police_pic.scaleX = 0.8
        this.police_pic.scaleY = 0.8
        this.police_pic.setDepth(1)
        this.robber_pic = this.add.image(120, 460 + 60, 'robber_picbg')
        this.robber_pic.scaleX = 0.8
        this.robber_pic.scaleY = 0.8
        this.soldier_pic = this.add.image(120, 640 + 60, 'soldier_picbg')
        this.soldier_pic.scaleX = 0.8
        this.soldier_pic.scaleY = 0.8


        this.soldier = this.add.image(400, 700, 'soldier_bg')
        this.soldier.scaleX = 0.9
        this.soldier.scaleY = 0.9
        this.farmer = this.add.image(400, 340, 'farmer_bg')
        this.farmer.scaleX = 0.9
        this.farmer.scaleY = 0.9
        this.police = this.add.image(400, 520, 'police_bg')
        this.police.scaleX = 0.9
        this.police.scaleY = 0.9
        this.robber = this.add.image(400, 160, 'robber_bg')
        this.robber.scaleX = 0.9
        this.robber.scaleY = 0.9

        // this.showHand()
        // this.showGraphic_hand()
        this.arr_key = [{
                id: 1,
                name: "farmer_pic",
                x: 120,
                y: 160,
                pic_x: 118,
                pic_y: 144,
                falg: false
            },
            {
                id: 2,
                name: "police_pic",
                x: 120,
                y: 340,
                pic_x: 118,
                pic_y: 144,
                falg: false
            },
            {
                id: 3,
                name: "robber_pic",
                x: 120,
                y: 520,
                pic_x: 118,
                pic_y: 144,
                falg: false
            },
            {
                id: 4,
                name: "soldier_pic",
                x: 120,
                y: 700,
                pic_x: 118,
                pic_y: 144,
                falg: false
            }
        ]
        this.arr_value = [{
                id: 3,
                name: "robber",
                x: 400,
                y: 160,
                pic_x: 146,
                pic_y: 40
            },
            {
                id: 1,
                name: "farmer",
                x: 400,
                y: 340,
                pic_x: 146,
                pic_y: 40
            },
            {
                id: 2,
                name: "police",
                x: 400,
                y: 520,
                pic_x: 146,
                pic_y: 40
            },
            {
                id: 4,
                name: "soldier",
                x: 400,
                y: 700,
                pic_x: 146,
                pic_y: 40
            }
        ]
        this.match(this.arr_key, this.arr_value)
        this.showHand()



        this.resize();
        window.addEventListener("resize", this.resize, false);
    }
    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.showGraphic_hand()
        this.input.on('pointerdown', () => {
            bool = 1
            this.hand.visible = 0
        }, this)
        // console.log(this.num)
        if (this.arr_key.length == this.num) {
            setTimeout(() => {
                this.download(4)
            }, 800);
            this.num = 0
        }
    }
    //手引导
    showHand() {
        this.hand = this.add.image(this.arr_key[this.arr_key.length - 3].x, this.arr_key[this.arr_key.length - 3].y, 'hand').setOrigin(0, 0)
        this.hand.scaleX = 0.5
        this.hand.scaleY = 0.5
        this.hand.setDepth(1)
        this.tweens.add({
            targets: [this.hand],
            x: this.arr_value[this.arr_value.length - 2].x,
            y: this.arr_value[this.arr_value.length - 2].y,
            duration: 600,
            callbackScope: this,
            onComplete: () => {
                setTimeout(() => {
                    this.tweens.add({
                        targets: [this.hand],
                        x: this.arr_key[this.arr_key.length - 3].x,
                        y: this.arr_key[this.arr_key.length - 3].y,
                        duration: 1
                    })
                }, 300);
            }
        })
        this.hand_interval = setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                x: this.arr_value[this.arr_value.length - 2].x,
                y: this.arr_value[this.arr_value.length - 2].y,
                duration: 600,
                callbackScope: this,
                onComplete: () => {
                    setTimeout(() => {
                        this.tweens.add({
                            targets: [this.hand],
                            x: this.arr_key[this.arr_key.length - 3].x,
                            y: this.arr_key[this.arr_key.length - 3].y,
                            duration: 1
                        })
                    }, 300);
                }
            })
        }, 1800);
    }

    //引导划线
    showGraphic_hand() {
        if (bool == 0) {
            if (this.graphics_hand) {
                this.graphics_hand.visible = 0
            }
            this.graphics_hand = this.add.graphics(0, 0)
            this.graphics_hand.lineStyle(5, 0xaeb4c1, 1.0);
            this.graphics_hand.moveTo(this.arr_key[this.arr_key.length - 3].x + this.arr_key[this.arr_key.length - 3].pic_x / 2, this.arr_key[this.arr_key.length - 3].y);
            this.graphics_hand.lineTo(this.hand.x, this.hand.y);
            this.graphics_hand.strokePath();
        } else {
            this.graphics_hand.visible = 0
            return
        }

    }

    // 连线
    match(arr_key, arr_value) {
        var falg = 0
        this.num = 0
        this.input.on('pointerdown', (pointer) => {
            for (var i = 0; i < arr_key.length; i++) {
                if ((arr_key[i].x - arr_key[i].pic_x / 2) <= pointer.x && pointer.x <= (arr_key[i].x + arr_key[i].pic_x / 2) && (arr_key[i].y - arr_key[i].pic_y / 2) <= pointer.y && pointer.y <= (arr_key[i].y + arr_key[i].pic_y / 2) && arr_key[i].falg == false) {
                    // console.log(arr_key[i].name)
                    this.a = i
                    this.input.on('pointermove', (pointer) => {
                        if (this.graphics) {
                            this.graphics.visible = 0
                        }
                        this.graphics = this.add.graphics(0, 0)
                        this.graphics.lineStyle(5, 0xaeb4c1, 1.0);
                        this.graphics.moveTo(arr_key[this.a].x + arr_key[this.a].pic_x / 2, arr_key[this.a].y);
                        this.graphics.lineTo(pointer.x, pointer.y);
                        this.graphics.strokePath();
                        // console.log(arr_key[this.a].y)
                        //进入value范围
                        for (var j = 0; j < arr_value.length; j++) {
                            if (arr_value[j].x - arr_value[j].pic_x / 2 <= pointer.x && pointer.x <= arr_value[j].x + arr_value[j].pic_x / 2 && arr_value[j].y - arr_value[j].pic_y / 2 <= pointer.y && pointer.y <= arr_value[j].y + arr_value[j].pic_y / 2) {
                                console.log(arr_value[j].id)
                                this.j = j

                                if (arr_value[j].id == arr_key[this.a].id) {
                                    // if(falg == 0){
                                    console.log('right')
                                    if (this.graphics) {
                                        this.graphics.visible = 0
                                    }
                                    this.graphics1 = this.add.graphics(0, 0)
                                    this.graphics1.lineStyle(5, 0x79b669, 1.0);
                                    this.graphics1.moveTo(arr_key[this.a].x + arr_key[this.a].pic_x / 2, this.arr_key[this.a].y);
                                    this.graphics1.lineTo(arr_value[this.j].x - arr_value[this.j].pic_x / 2, this.arr_value[this.j].y);
                                    this.graphics1.strokePath();
                                    this.right = this.add.image(arr_value[this.j].x, this.arr_value[this.j].y, 'right')
                                    this.right.visible = 0
                                    this.right.scaleX = 0.6
                                    this.right.scaleY = 0.6
                                    this.tweens.add({
                                        targets: [this.right],
                                        visible: 1,
                                        angle: 15,
                                        duration: 200,
                                        callbackScope: this,
                                        onComplete: () => {
                                            this.tweens.add({
                                                targets: [this.right],
                                                angle: -15,
                                                duration: 200,
                                                callbackScope: this,
                                                onComplete: () => {
                                                    this.right.visible = 0
                                                }
                                            })
                                        }
                                    })
                                    this.input.off('pointermove')
                                    arr_key[this.a].falg = true
                                    this.num++
                                    // window.localStorage.setItem("id",arr_key[j].id)
                                    // arr_value.splice(this.j)
                                    // }
                                } else {
                                    console.log('no')
                                    if (this.graphics) {
                                        this.graphics.visible = 0
                                    }
                                    this.graphics1 = this.add.graphics(0, 0)
                                    this.graphics1.lineStyle(5, 0xf17172, 1.0);
                                    this.graphics1.moveTo(arr_key[this.a].x + arr_key[this.a].pic_x / 2, this.arr_key[this.a].y);
                                    this.graphics1.lineTo(arr_value[this.j].x - arr_value[this.j].pic_x / 2, this.arr_value[this.j].y);
                                    this.graphics1.strokePath();
                                    this.input.off('pointermove')
                                    this.wrong = this.add.image(arr_value[this.j].x, this.arr_value[this.j].y, 'wrong')
                                    this.wrong.visible = 0
                                    this.wrong.scaleX = 0.6
                                    this.wrong.scaleY = 0.6
                                    this.tweens.add({
                                        targets: [this.wrong],
                                        visible: 1,
                                        angle: 15,
                                        duration: 200,
                                        callbackScope: this,
                                        onComplete: () => {
                                            this.tweens.add({
                                                targets: [this.wrong],
                                                angle: -15,
                                                duration: 200,
                                                callbackScope: this,
                                                onComplete: () => {
                                                    this.wrong.destroy()
                                                }
                                            })
                                        }
                                    })
                                    setTimeout(() => {
                                        this.graphics1.destroy()
                                    }, 400);
                                }
                            }
                        }
                    }, this)

                }
            }
        }, this)
        this.input.on('pointerup', () => {
            if (this.graphics) {
                this.graphics.destroy()
                this.input.off('pointermove')
            }
        }, this)

    }

    // 下载
    download(n) {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.85;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        if (n == 4) {
            this.success = this.add.image(256, 400, 'success')
            this.success.scaleX = 0
            this.success.scaleY = 0
            this.success.setDepth(9)
            this.tweens.add({
                targets: [this.success],
                scaleX: 1,
                scaleY: 1,
                duration: 400,
                callbackScope: this,
                onComplete: () => {
                    this.continue = this.add.image(256, 500, 'continue').setInteractive()
                    this.continue.setDepth(9)
                    this.continue.on('pointerdown', () => {
                        landingPage()
                    }, this)
                }
            })
        }
        if (n == 5) {
            this.fail = this.add.image(256, 400, 'fail')
            this.fail.scaleX = 0
            this.fail.scaleY = 0
            this.fail.setDepth(9)
            this.tweens.add({
                targets: [this.fail],
                scaleX: 1,
                scaleY: 1,
                duration: 400,
                callbackScope: this,
                onComplete: () => {
                    this.download = this.add.image(186, 500, 'download').setInteractive()
                    this.repty = this.add.image(326, 500, 'repty').setInteractive()
                    this.download.setDepth(9)
                    this.repty.setDepth(9)
                    this.download.on('pointerdown', () => {
                        landingPage()
                    }, this)
                    this.repty.on('pointerdown', () => {
                        this.scene.start("PlayGame")
                    }, this)
                }
            })
        }

    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

var assets = {"police_pic": "data:image/png;base64,", "right": "data:image/png;base64,", "robber_picbg": "data:image/png;base64,", "fail": "data:image/png;base64,", "soldier_bg": "data:image/png;base64,", "Altr_Gea": "data:image/x-win-bitmap;base64,", "farmer_pic": "data:image/png;base64,", "download": "data:image/png;base64,", "pencil2": "data:image/x-win-bitmap;base64,", "police_picbg": "data:image/png;base64,", "police": "data:image/png;base64,", "police_bg": "data:image/png;base64,", "farmer": "data:image/png;base64,", "farmer_bg": "data:image/png;base64,", "pencil": "data:image/x-win-bitmap;base64,", "bg": "data:image/png;base64,", "farmer_picbg": "data:image/png;base64,", "robber_pic": "data:image/png;base64,", "pencil_1_1": "data:image/x-win-bitmap;base64,", "hand": "data:image/png;base64,", "repty": "data:image/png;base64,", "wrong": "data:image/png;base64,", "robber_bg": "data:image/png;base64,", "soldier_pic": "data:image/png;base64,", "robber": "data:image/png;base64,", "soldier_picbg": "data:image/png;base64,", "success": "data:image/png;base64,", "pencil_1": "data:image/x-win-bitmap;base64,", "soldier": "data:image/png;base64,", "continue": "data:image/png;base64,"}